import React, { Component } from 'react';
import Prism from "prismjs"
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import '../../ReactJs/styles.css'
import Sidebar from '../sidebar';
import PrismCode from '../../ReactJs/prismCode';

import Stcksval from '../../../assets/stcks.png';

const titles = { backgroundColor: '#F0F8FF', padding: '1px', fontSize: '16px' }

const redesign = {
  height: 200,
  width: 500
}

const styles = theme => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1)
  },
  smMargin: {
    margin: theme.spacing(1)
  },
  actionDiv: {
    textAlign: "center"
  }
})


const maxLength = `
const maxLength = function (arr) {
  let max = 0
  const isUnique = (s = '') => {
    const map = {}
    for (const c of s) {
      map[c] = (map[c] || 0) + 1
      if (map[c] >= 2) {
        return false
      }
    }
    return true
  }
  const aux = (index, current = '') => {
    if (index > arr.length - 1) {
      max = Math.max(current.length, max)
      return
    }
    if (isUnique(current)) {
      aux(index + 1, current)
      if (isUnique(current + arr[index])) {
        aux(index + 1, current + arr[index])
      }
    }
  }
  aux(0)
  return max
}

console.log(maxLength(["un","iq","ue"]))`.trim();

const twoSum = `
const twoSum = (nums, target) => {
  const memo = {}
  const aux = (index) => {
    if (memo[nums[index]] !== undefined) {
      return [memo[nums[index]], index]
    }
    memo[target - nums[index]] = index
    return aux(index + 1)
  }
  return aux(0, nums.length - 1)
}

console.log(twoSum([2,7,11,15],18))`.trim();

const addTwoNumbers = `
function ListNode(val) {
  this.val = val
  this.next = null
}

const addTwoNumbers = (l1, l2) => {
  let h1 = l1
  let h2 = l2
  let digit = 0
  let head = null
  let current = null
  while (h1 || h2) {
    const num1 = h1 ? h1.val : 0
    const num2 = h2 ? h2.val : 0
    let value = num1 + num2 + digit
    if (value >= 10) {
      value -= 10
      digit = 1
    } else {
      digit = 0
    }
    h1 = h1 ? h1.next : null
    h2 = h2 ? h2.next : null
    const node = new ListNode(value)
    if (!head) {
      head = node
      current = node
    } else {
      current.next = node
      current = node
    }
  }
  if (digit === 1) {
    current.next = new ListNode(1)
  }
  return head
}


console.log(addTwoNumbers())`.trim();

const lengthOfLongestSubstring = `
const lengthOfLongestSubstring = (s = '') => {
  const map = {}
  let max = 0
  let left = -1
  for (let i = 0; i < s.length; i++) {
    if (map[s[i]] !== undefined) {
      left = Math.max(left, map[s[i]])
      max = Math.max(i - left, max)
    } else {
      max = Math.max(i - left, max)
    }
    map[s[i]] = i
  }
  return max
}


console.log(lengthOfLongestSubstring("pwwkew"))`.trim();

const findMedianSortedArrays = `
const findMedianSortedArrays = (nums1, nums2) => {
  const merge = (xs1, xs2) => {
    if (!xs1 || !xs1.length) {
      return xs2
    }
    if (!xs2 || !xs2.length) {
      return xs1
    }
    const [hd1, ...rest1] = xs1
    const [hd2, ...rest2] = xs2
    return hd1 <= hd2 ? [hd1, ...merge(rest1, xs2)] : [hd2, ...merge(xs1, rest2)]
  }
  const nums = merge(nums1, nums2)
  const middle = Math.floor((nums.length-1) / 2)

  return (middle * 2 === (nums.length-1)) ?  nums[middle] : ((nums[middle] + nums[middle + 1]) / 2) 
}


console.log(findMedianSortedArrays([1,2],[3,4]))`.trim();

const longestPalindrome = `
const longestPalindrome = (s = '') => {
  const memo = {}
  const isPalindrome = (left, right) => {
    if (left === right) {
      return true
    }
    for (let i = left; i <= Math.floor((left + right) / 2); i++) {
      if (s[i] !== s[right - i + left]) {
        return false
      }
    }
    return true
  }
  const aux = (left, right) => {
    if (left > right) {
      return ''
    }
    memo[left] = memo[left] || {}
    if (memo[left][right] !== undefined) {
      return memo[left][right]
    }
    if (isPalindrome(left, right)) {
      return s.substring(left, right + 1)
    }
    memo[left][right] = aux(left + 1, right).length > aux(left, right - 1).length
      ? aux(left + 1, right)
      : aux(left, right - 1)
    return memo[left][right]
  }
  return aux(0, s.length - 1)
}

console.log(longestPalindrome("babad"))`.trim();

const convert = `
const convert = function (s, numRows) {
  if (numRows === 1) {
    return s
  }
  const arr = new Array(numRows).fill("")
  let i = 0
  let down = true
  for (const c of s) {
    arr[i] += c
    if (down) {
      i += 1
      if (i === numRows - 1) {
        down = false
      }
    } else {
      i -= 1
      if (i === 0) {
        down = true
      }
    }
  }
  return arr.join('')
}


console.log(convert("PAYPALISHIRING",3))`.trim();

const reverse = `
const reverse = function (x) {
  let max = (2 ** 31) - 1
  let min = - (2 ** 31)

  const isMinus = x < 0
  const str = String(Math.abs(x)).split('').reverse().join('')
  const result =  isMinus ? Number('-'$'{str}') : Number(str)
  if (result > max || result < min) {
    return 0
  }
  return result
}


console.log(reverse(123))`.trim();

const isPalindrome = `
const isPalindrome = function (x) {
  if (x < 0) {
    return false
  }
  let reverse = 0
  let num = x
  while (num > 0) {
    reverse = reverse * 10 + (num % 10)
    num = Math.floor(num / 10)
  }
  return reverse === x
}


console.log(isPalindrome(121)) `.trim();

const maxArea = `
const maxArea = (height = []) => {
  let max = 0
  let left = 0
  let right = height.length - 1
  while (left < right) {
    max = Math.max(max, Math.min(height[left], height[right]) * (right - left))
    if (height[left] <= height[right]) {
      left += 1
    } else {
      right -= 1
    }
  }
  return max
}

console.log(maxArea([1,8,6,2,5,4,8,3,7]))`.trim();


class DSLogic extends Component {
  componentDidMount() {
    setTimeout(() => Prism.highlightAll(), 0)
  }
  render() {
    const { classes } = this.props;
    return (
      <Grid container>
        <Grid item xs={2}>
          <Paper className={classes.paper}>
            <h4><Sidebar /></h4>
          </Paper>
        </Grid>
        <Grid item xs={10}>
          <Paper className={classes.paper}>
            <List>
            <h3>1. Maximum Length of a Concatenated String with Unique Characters.</h3>
        iven an array of strings arr. String s is a concatenation of a sub-sequence of arr which have unique characters.
        <br/>
        Return the maximum possible length of s.
        <br/>
        <br/>

        Example 1:
        <br/>
        Input: arr = ["un","iq","ue"]<br/>
        Output: 4<br/>
        Explanation: All possible concatenations are "","un","iq","ue","uniq" and "ique".<br/>
        Maximum length is 4.
            <div style={titles}>
                <PrismCode
                  code={maxLength}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>2. Two Sum.</h3>
              Description<br/>
Given an array of integers nums and an integer target, return indices of the two numbers such that they add up to target.
<br/>
You may assume that each input would have exactly one solution, and you may not use the same element twice.
<br/>
You can return the answer in any order.
<br/>


Example 1:
<br/>
Input: nums = [2,7,11,15], target = 9<br/>
Output: [0,1]<br/>
Output: Because nums[0] + nums[1] == 9, we return [0, 1].
              <div style={titles}>
                <PrismCode
                  code={twoSum}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>3. Add Two Numbers.</h3>
              You are given two non-empty linked lists representing two non-negative integers. The digits are stored in reverse order and each of their nodes contain a single digit. Add the two numbers and return it as a linked list.
              <br/>
You may assume the two numbers do not contain any leading zero, except the number 0 itself.
<br/>
Example:
<br/>
Input: (2  4  3) + (5  6  4)<br/>
Output: 7  0  8<br/>
Explanation: 342 + 465 = 807.
              <div style={titles}>
                <PrismCode
                  code={addTwoNumbers}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>4. Longest Substring Without Repeating Characters.</h3>
              Given a string s, find the length of the longest substring without repeating characters.
              <br/>


Example 1:
<br/>
Input: s = "abcabcbb"<br/>
Output: 3<br/>
Explanation: The answer is "abc", with the length of 3.<br/><br/>
Example 2:<br/>

Input: s = "bbbbb"<br/>
Output: 1<br/>
Explanation: The answer is "b", with the length of 1.
              <div style={titles}>
                <PrismCode
                  code={lengthOfLongestSubstring}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>5. Median of Two Sorted Arrays.</h3>
              Given two sorted arrays nums1 and nums2 of size m and n respectively, return the median of the two sorted arrays.
              <br/>
Follow up: The overall run time complexity should be O(log (m+n)).
<br/>


Example 1:
<br/>
Input: nums1 = [1,3], nums2 = [2]<br/>
Output: 2.00000<br/>
Explanation: merged array = [1,2,3] and median is 2.<br/><br/>
Example 2:<br/>

Input: nums1 = [1,2], nums2 = [3,4]<br/>
Output: 2.50000<br/>
Explanation: merged array = [1,2,3,4] and median is (2 + 3) / 2 = 2.5.
              <div style={titles}>
                <PrismCode
                  code={findMedianSortedArrays}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>6. Longest Palindromic Substring.</h3>
              Given a string s, find the longest palindromic substring in s. You may assume that the maximum length of s is 1000.
              <br/>
Example 1:
<br/>
Input: "babad"<br/>
Output: "bab"<br/>
Note: "aba" is also a valid answer.<br/><br/>
Example 2:<br/>

Input: "cbbd"<br/>
Output: "bb"
              <div style={titles}>
                <PrismCode
                  code={longestPalindrome}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>7. ZigZag Conversion.</h3>
              The string "PAYPALISHIRING" is written in a zigzag pattern on a given number of rows like this: (you may want to display this pattern in a fixed font for better legibility)
              <br/>
P   A   H   N<br/>
A P L S I I G<br/>
Y   I   R<br/>
And then read line by line: "PAHNAPLSIIGYIR"<br/>

Write the code that will take a string and make this conversion given a number of rows:<br/>

string convert(string s, int numRows);<br/><br/>
Example 1:<br/>

Input: s = "PAYPALISHIRING", numRows = 3<br/>
Output: "PAHNAPLSIIGYIR"<br/><br/>
Example 2:<br/>

Input: s = "PAYPALISHIRING", numRows = 4<br/>
Output: "PINALSIGYAHRPI"<br/>
Explanation:<br/>
P     I    N<br/>
A   L S  I G<br/>
Y A   H R<br/>
P     I
              <div style={titles}>
                <PrismCode
                  code={convert}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>8. Reverse Integer.</h3>

              <div style={titles}>
                <PrismCode
                  code={reverse}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>9. Palindrome Number.</h3>
              Determine whether an integer is a palindrome. An integer is a palindrome when it reads the same backward as forward.
              <br/> <br/>
Example 1:
<br/>
Input: 121 <br/>
Output: true
              <div style={titles}>
                <PrismCode
                  code={isPalindrome}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>10. Container With Most Water</h3>
              Given n non-negative integers a1, a2, ..., an , where each represents a point at coordinate (i, ai). n vertical lines are drawn such that the two endpoints of line i is at (i, ai) and (i, 0). Find two lines, which together with x-axis forms a container, such that the container contains the most water.
              <br/><br/>
<b>Note: </b>You may not slant the container and n is at least 2.
<br/><br/>
Example:<br/>

Input: [1,8,6,2,5,4,8,3,7]<br/>
Output: 49
              <div style={titles}>
                <PrismCode
                  code={maxArea}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
            </List>
          </Paper>
        </Grid>
      </Grid>
    )
  }
}

export default (withStyles(styles)(DSLogic));
